import React from "react";
import { Carousel } from "react-bootstrap";

function ListingImageCarousel({ img }) {
  return (
    <Carousel.Item>
      <img className="d-block w-100" src={img} />
    </Carousel.Item>
  );
}

export default ListingImageCarousel;
